package com.matao.bean;import java.io.Serializable;/** * @author: ZhouYang * @E-mail: ZhouYangGaoGao@163.com * @time:2015-5-4 上午9:57:59 * @Description:TODO */public class DaTePager implements Serializable {	private int TotalCount;	private int PageCount;	private String QueryTime;	@Override	public String toString() {		return "DaTePager [TotalCount=" + TotalCount + ", PageCount="				+ PageCount + ", QueryTime=" + QueryTime + "]";	}	public int getTotalCount() {		return TotalCount;	}	public void setTotalCount(int totalCount) {		TotalCount = totalCount;	}	public int getPageCount() {		return PageCount;	}	public void setPageCount(int pageCount) {		PageCount = pageCount;	}	public String getQueryTime() {		return QueryTime;	}	public void setQueryTime(String queryTime) {		QueryTime = queryTime;	}}